   collectionSize = 0;
  ligneVente: any = {};
  submit: boolean = false;

   getPremiumData() {
     this.paginateData = this.ventesTab.slice(
       (this.page - 1) * this.pageSize,
       (this.page - 1) * this.pageSize + this.pageSize
     );
   }




   modalTitle: any = '';
   detailsVenteTab: any = [];
