  constructor( private modalService: NgbModal, private venteServices: VenteproduitsService,
    public fb: FormBuilder, private notifications: NotifService, private user: UserService,
    private cryptDataService: CryptDataService, private exportpdf: DataprintformatService,) {
      this.searchData = this.fb.group({
        p_date: ['', [Validators.required]],
        p_date_retour: ['', ]
      });
    }

  ngOnInit(): void {
    this.userData = this.user._donnesUtilisateur()[0];
    this.breadCrumbItems = [{ label: 'Eden décoration' }, { label: 'Liste des ventes', active: true }];

    //this._listVentes('');
  }

  get searchValidate() { return this.searchData.controls;}

  _listVentes(datedebut, datefin): void {
    this.viewTable = false;
    try {
      this.venteServices._listventes(datedebut,datefin).subscribe(
        (data: any) => {

          let fournisseurs = this.cryptDataService.decrypt(data);
          this.ventesTab = [...fournisseurs.original._result];

          this.collectionSize = this.ventesTab.length;
          this.getPremiumData();
          setTimeout(() => {
            this.viewTable = true;
          }, 500);
        },
        (err) => {console.log(err);
        }
      );
    } catch (error) {
      console.log(error)
    }


    }


    _actionLocation(largeDataModal, ligneVente, mode){
      this.ligneVente = {...ligneVente};
      this.modalTitle = `Détails vente de [ ${this.ligneVente.r_nom} ${this.ligneVente.r_prenoms} ]`;
      console.log(ligneVente);

      this.venteServices._details_ventes(this.ligneVente.id).subscribe(
        (result: any) => {
          this.detailsVenteTab = result;
          console.log(result);

        },
        (error)=> {
          console.log(error);

        }
      )

      this.largeModal(largeDataModal);
    }


    //Appel de la modal
  largeModal(exlargeModal: any) {
    this.modalService.open(exlargeModal, { size: 'xl', centered: true });
  }


  _exe_search_location(){
    this.submit = true;

    const datedebut = this.searchData.value.p_date.split('T')[0];
    const datefin = this.searchData.value.p_date_retour?.split('T')[0];
    this._listVentes(datedebut,datefin);
  }

  public imprimFacture(ventes){
    this.ligneVente = {...ventes};
        let dataPrint: any = [];
        let dataPrintTitle: any = [
                                    {text:'Produits', bold:true, italics: true,alignment:"center",},
                                    {text:'Quantités', bold:true, italics: true,alignment:"center",},
                                    {text:'Prix unitaire', bold:true, italics: true,alignment:"center",},
                                    {text:'Sous total', bold:true, italics: true,alignment:"center",}
                                  ];

        dataPrint.push(dataPrintTitle);

        this.venteServices._details_ventes(this.ligneVente.id).subscribe(
          (data: any) => {
            this.detailsVenteTab = [...data];
            //Produts à imprimer
            this.detailsVenteTab.forEach((el)=>{
              let obj: any = {}
              obj.produit = el.r_nom_produit,
              obj.quantite = el.r_quantite,
              obj.prix_location = el.r_prix_vente,
              obj.sous_total = el.r_sous_total

              dataPrint.push(obj);
            });
            dataPrint.push([{text: '-------------------------------------------------------------------------------------------------------------------',
            background:"#ACACAC", color: "#ACACAC",alignment:"justify",colSpan:4, }]);

            dataPrint.push([{text: 'Rémise', colSpan:3},'','', (this.ligneVente?.r_remise >= 100)? this.ligneVente?.r_remise : 0]);

            dataPrint.push([{text: 'Total après rémise', colSpan:3},'','', {text: parseInt(this.ligneVente?.r_mnt_total), color: "blue"}]);



            dataPrint.push([{text: 'Total à payer', colSpan:3},'','',
            {text: parseInt(this.ligneVente?.r_mnt_total), color: "blue"}]);

            /* if( this.paymntTab !== "null" ){
              dataPrint.push([{text: 'Avance', colSpan:3},'','', {text: (this.ligneVente.r_solder !== 0)? 0 : this.totalPaiement, color: "black"}]);
              dataPrint.push([{text: 'Réliquat', colSpan:3},'','', {text:  this.ligneVente?.r_mnt_total_remise - this.totalPaiement, color: "black"}]);
            } */



            // Données transport produits
            // tranportData.push([{text: 'Frais'},{text:this.ligneVente?.r_frais_transport}]);
            // tranportData.push([{text: 'Véhicule'},{text:this.ligneVente?.r_vehicule + ' | ' +this.ligneVente?.r_matricule}]);
            // tranportData.push([{text: 'Destination'},{text:this.ligneVente?.destination}]);
            //Formatage des données pour la génération du pdf

            let dd = this.exportpdf.printData(dataPrint);


            this.export(dd, this.ligneVente);
            dd = [];
            dataPrintTitle = [];
            dataPrint = [];


          },
          (err) => {console.log(err.stack);
          }
        );
  }

